import React from 'react';
import { Route } from 'react-router-dom';

import HomePage from './pages/HomePage';
import GlobalStyle from './utils/globalStyles';

const App = () => (
	<>
		<GlobalStyle />
		<Route exact path="/" component={HomePage} />
		<HomePage />
	</>
);

export default App;
